import React from 'react';
import Nav from './navBar/nav';
import Main from './main/main';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

export default function App() {
    return(
    <Router>
        <>
        <Nav />
        <Main className="bg"/>   
        </>

    </Router>
    )
}
